       <Pagination>
           {page !==1 &&<Pagination.Prev />}
    <Pagination.Item>{page -1}</Pagination.Item>
    <Pagination.Item>{page}</Pagination.Item>
    <Pagination.Item>{page +1}</Pagination.Item>
           <Pagination.Next/>
       </Pagination>
    )
}
